import React, { Component } from "react";
import HeaArr from "../../components/HeaArr";
import axios from "axios";
import Test from "../RestProfile/test";

// const url =
//   "http://ec2-18-216-57-107.us-east-2.compute.amazonaws.com/api/plate/filter";

class MenuList extends Component {
  constructor(props) {
    super(props);
    this.state = {
      getDishes: [],
    };
  }
  componentDidMount() {
    axios
      .get(
        "http://ec2-18-216-57-107.us-east-2.compute.amazonaws.com/api/restaurant/1/menus/"
      )
      .then((response) => {
        console.log(response.data.menus);
        this.setState({ getDishes: response.data.menus });
      })
      .catch((error) => {
        console.log(error);
      });
  }
  render() {
    return (
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
        }}
      >
        <HeaArr />
        <h3
          style={{
            fontFamily: "GothamBold",
            display: "flex",
            justifyContent: "center",
          }}
        >
          Mis men√∫s
        </h3>

        {this.state.getDishes.map((e) => (
          <p key={e.id} value={e.id}>
            <span>
              {e.title}..................................{e.price}
            </span>
          </p>
        ))}
      </div>
    );
  }
}

export default MenuList;
